import React from 'react'
import '../style.css';
import Card_Item from './Card-Item';
const Projects = () => {
    return (
        <div className='project-page'>
            <div className='heading'>
                <h1>Projects</h1>
                <div className='projects' data-aos="fade-up">
                    <Card_Item />
                </div>
            </div>
        </div>
    )
}

export default Projects
